import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Sidebar from "./components/Sidebar";
import Header from "./components/Header";
import Dashboard from "./components/Dashboard";
import Sector1 from "./components/Sector1";
import Sector2 from "./components/Sector2";
import Sector3 from "./components/Sector3";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="app">
        <Sidebar />
        <div className="main-content">
          <Header />
          <Switch>
            <Route path="/" exact component={Dashboard} />
            <Route path="/sector1" component={Sector1} />
            <Route path="/sector2" component={Sector2} />
            <Route path="/sector3" component={Sector3} />
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
